import { Link, useLocation } from "react-router-dom";

import expressLogo from "./media/express-logo.svg";
import mongoLogo from "./media/mongo-logo.svg";
import nodeLogo from "./media/node-logo.svg";
import psqlLogo from "./media/psql-logo.svg";
import reactLogo from "./media/react-logo.svg";

import "./style.min.css";

const App = () => {
  const location = useLocation();

  return (
    <div className="app">
      <header className="header">
        <div className="header-container">
          <div className="title-box">
            <Link to="/">
              <h1 className="name">Dougie Hawes</h1>
              <p className="occupation">FullStack Web Developer</p>
              <div className="stack-logos">
                <img src={psqlLogo} alt="" />
                <img src={mongoLogo} alt="" />
                <img src={expressLogo} alt="" />
                <img src={reactLogo} alt="" />
                <img src={nodeLogo} alt="" />
              </div>
            </Link>
          </div>
          <nav className="navbar">
            <div className="navbar-container">
              <Link
                className={`nav-link ${
                  location.pathname == "/work" && "nav-link-active"
                }`}
                to="/work"
              >
                Work
                <div className="nav-link-underline"></div>
              </Link>
              <Link
                className={`nav-link ${
                  location.pathname == "/skills" && "nav-link-active"
                }`}
                to="/skills"
              >
                Skills
                <div className="nav-link-underline"></div>
              </Link>
              <Link
                className={`nav-link ${
                  location.pathname == "/about" && "nav-link-active"
                }`}
                to="/about"
              >
                About
                <div className="nav-link-underline"></div>
              </Link>
              <Link
                className={`nav-link ${
                  location.pathname == "/contact" && "nav-link-active"
                }`}
                to="/contact"
              >
                Contact
                <div className="nav-link-underline"></div>
              </Link>
            </div>
          </nav>
        </div>
      </header>
    </div>
  );
};

export default App;
